import './App.css';


import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';

import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  Router,
  Routes,
} from "react-router-dom";


export default class App extends Component {
  name = "saket";
  render() {

    return (
      <div>
        <Router>
        <Navbar/>
        <Routes>
          <Route path='/about'></Route>          
          <Route path='/business'><News pageSize = {5} category = "" country="in" /> </Route>
          <Route path='/entertainment'><News pageSize = {5} category = "sports" country="in" /> </Route>
          <Route path='/general'><News pageSize = {5} category = "sports" country="in" /></Route>
          <Route path='/health'><News pageSize = {5} category = "sports" country="in" /></Route>
          <Route path='/science'><News pageSize = {5} category = "sports" country="in" /></Route>
          <Route path='/sports'><News pageSize = {5} category = "sports" country="in" /></Route>
          <Route path='/technology'><News pageSize = {5} category = "sports" country="in" /></Route>

        </Routes>
        </Router>
      </div>
    )
  }
}
